import React from 'react';
import { Link } from 'react-router-dom';
import { Icon } from '../icon';

const HomeBar = () => {
    return (
        <Link to="#" className='px-3 py-3 mb-[2px] rounded-3xl duration-150 ease-linear flex items-center text-link gap-x-4 font-normal group hover:bg-linkHover'>
            <div className='group-hover:scale-[1.1] duration-150'>
                <Icon name="home" />
            </div>
            <span>Ana Sayfa</span>
        </Link>
    );
};

export default HomeBar;
